    "/v1/database/{path}/symbols": {
      "get": {
        "tags": [
          "View"
        ],
        "description": "Returns all the symbols in the database(OFDB, OMS_OFDB, ECONOFDB)",
        "parameters": [
          {
            "$ref": "#/components/parameters/databaseLocationPathParam"
          },
          {
            "name": "startsWith",
            "in": "query",
            "description": "Returns list of symbols which starts with mentioned string",
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "endsWith",
            "in": "query",
            "description": "Returns list of symbols which ends with mentioned string",
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "contains",
            "in": "query",
            "description": "Returns list of symbols which contains mentioned string",
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "equals",
            "in": "query",
            "description": "Returns symbol which matches mentioned string",
            "schema": {
              "type": "string"
            }
          },
          {
            "name": "orderBy",
            "in": "query",
            "description": "Returns symbols in the mentioned sorted order, should provide asc or desc",
            "schema": {
              "type": "string",
              "enum": [
                "asc",
                "desc"
              ]
            }
          }
        ],
        "responses": {
          "200": {
            "description": "successful symbols array",
            "headers": {
              "X-DataDirect-Request-Key": {
                "$ref": "#/components/headers/X-DataDirect-Request-Key"
              },
              "X-FactSet-Api-Request-Key": {
                "$ref": "#/components/headers/X-FactSet-Api-Request-Key"
              },
              "X-RateLimit-Limit": {
                "$ref": "#/components/headers/X-RateLimit-Limit"
              },
              "X-RateLimit-Remaining": {
                "$ref": "#/components/headers/X-RateLimit-Remaining"
              },
              "X-RateLimit-Reset": {
                "$ref": "#/components/headers/X-RateLimit-Reset"
              }
            },
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/Symbols"
                }
              }
            }
          },
          "202": {
            "$ref": "#/components/responses/202LongRunningResponse"
          },
          "400": {
            "$ref": "#/components/responses/400Response"
          },
          "403": {
            "$ref": "#/components/responses/403Response"
          },
          "404": {
            "$ref": "#/components/responses/404Response"
          },
          "429": {
            "$ref": "#/components/responses/429Response"
          },
          "500": {
            "$ref": "#/components/responses/500Response"
          },
          "503": {
            "$ref": "#/components/responses/503Response"
          }
        }
      },
      "post": {
        "tags": [
          "Create"
        ],
        "description": "Creates a new symbol with single/multiple dates for 3d database(OFDB). Creates a symbol for 2d database(OFDB)",
        "parameters": [
          {
            "$ref": "#/components/parameters/databaseLocationPathParam"
          }
        ],
        "requestBody": {
          "description": "Data for creating symbol in the database",
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "symbol": {
                    "type": "string",
                    "description": "Name of the symbol and unique to this database"
                  },
                  "data": {
                    "type": "array",
                    "items": {},
                    "description": "date has to be provide in case 3d OFDB with date and atleast one iterative field"
                  }
                }
              },
              "examples": {
                "3dOFDB": {
                  "description": "Object in data is mandatory and must contain date with atleast one iterative field",
                  "value": {
                    "symbol": "FACTSET",
                    "data": [
                      {
                        "date": 20200202,
                        "field": "value"
                      }
                    ]
                  }
                },
                "2dOFDB": {
                  "description": "Object in data is optional and should contain fields of the OFDB",
                  "value": {
                    "symbol": "FACTSET",
                    "data": [
                      {
                        "field": "value"
                      }
                    ]
                  }
                }
              }
            }
          }
        },
        "responses": {
          "201": {
            "$ref": "#/components/responses/PostRequestsSuccessCompleteRespones"
          },
          "202": {
            "$ref": "#/components/responses/202LongRunningResponse"
          },
          "400": {
            "$ref": "#/components/responses/400Response"
          },
          "403": {
            "$ref": "#/components/responses/403Response"
          },
          "404": {
            "$ref": "#/components/responses/404Response"
          },
          "413": {
            "$ref": "#/components/responses/413Response"
          },
          "429": {
            "$ref": "#/components/responses/429Response"
          },
          "500": {
            "$ref": "#/components/responses/500Response"
          },
          "503": {
            "$ref": "#/components/responses/503Response"
          }
        }
      }
    },
    "/v1/database/{path}/symbols/{symbol}": {
      "put": {
        "tags": [
          "Modify"
        ],
        "description": "Updates an existing symbol field value for single/multiple dates or adds a new symbol/date within a symbol if not present in 3d database(OFDB). Updates an existing symbol field value or adds a new symbol if not present in the 2d database(OFDB)",
